import React, { Component } from "react";
export default class MedicineList extends Component {
    render() {
        let data = this.props.data;
        const newdata = data.map(item => {
            return (
                <li key={item.id} className="medicine"><div className="row">
                    <div className="col-lg-2"><img className="medicine_image" src={item.image} alt={item.name} /></div>
                    <div className="col-lg-10"><p className="medicine_name">{item.name}</p>
                        <p className="medicine_description">{item.description}&nbsp;<a href={"/medicines/" + item.id}>See more &raquo;</a></p></div>
                </div></li>
            );
        });
        return (<div className="container"><h2 class="medicines_heading">Medicines</h2><ul className="medicines_list">{newdata}</ul></div>);
    }
}
